import React from 'react'
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
const options = {
    names : ['MSFT'],
    chart: {
        type: 'spline'
      },
    title: {
      text: 'My chart'
    },
    xAxis      : { 
        min:Date.UTC(2020, 0, 0),
        max:Date.UTC(2020, 11, 1),
        allowDecimals: false,
        type           : 'datetime',
        tickInterval   : 24 * 3600 * 1000*30, //one day
        labels         : {
            rotation : 0
        }
    },
    series: [{
        data: [1, 2, 1, 4, 3, 6]
    }]
  }
class LineChart1 extends React.Component{
    constructor(){
        super()
    }
render(){
    return(
        <div>
  <HighchartsReact
    highcharts={Highcharts}
    options={options}
  />
        </div>
    )
}
}
export default LineChart1
